    // Define global variables
    var formioInstance;
    var isEditMode = false;

    // Initialize the form and load it into the container
    Formio.createForm(document.getElementById('formio'), {
      src: 'https://forms-stage.vialto.com/formio/kayla',
      readOnly: true
    }).then(function(form) {
      formioInstance = form;
    }).catch(function(error) {
      console.error(error);
    });

    // Function to toggle the edit mode
    function toggleEditMode() {
      isEditMode = !isEditMode;
      var buttonText = isEditMode ? 'Save' : 'Edit';
      document.getElementById('editButton').innerText = buttonText;

      // Enable or disable form fields based on the edit mode
      if (formioInstance) {
        formioInstance.setReadonly(!isEditMode);
      }
    }

